import React, {useState, useEffect} from 'react'
import axios from 'axios'
function Chart() {

    useEffect(() => {
        axios.get("https://covid19.mathdro.id/api/daily")
        .then(response => {
            console.log("Response", response)
        })
        .catch(error => {
            console.log("Error", error)
        })
    }, [])

    return (
        <div>
            <h1>Chart</h1>
        </div>
    )
}

export default Chart
